"use strict";

const math = require('mathjs');

function f_gold(n) {
    let dp = Array(n + 1).fill(0);
    for (let i = 1; i <= n; i++) {
        let j = 1, mi = Number.POSITIVE_INFINITY;
        while (j * j <= i) {
            mi = Math.min(mi, dp[i - j * j]);
            j += 1;
        }
        dp[i] = mi + 1;
    }
    return dp[dp.length - 1];
}
